					const set_actor_result = await match.setActor({
						session_id,
						name       : profile.name,
						properties : {
							""level""     : 1,
							""skill""     : 1,
							""vrmUrl""    : profile.activeAvatar.vrmUrl,
						}
					})
					const rooms_result     = await match.getAvailableRooms()
					if( rooms_result && rooms_result.success && 'rooms' in rooms_result && rooms_result.rooms.length ){
						room               = rooms_result.rooms[ 0 ]
						const join_result  = await match.joinRoom( room.id )
					} else {
						const create_result = await match.createRoom({
							name       : 'icosa gallery',
							mode       : 'team',
							maxPlayers : 12,
							minPlayers : 1,
							properties :{
								""level"" : 1,
								""skill"" : 1
							}
						})
						room = create_result.room
					}
					multi            = await play.newMultiplayerClient( room.id, app )
					const info       = await multi.init()
					multi.onConnected(_=>{ 
						multi.general.onMessage( msg =>{
							receive( msg )
						})
						
						multi.networksync.onNotifyPositionUpdate( data =>{ 
							const actor = find_actor( data.data.session_id )
							if( actor ){
								actor.properties.character.position.set( data.data.px, data.data.py, data.data.pz )
								actor.properties.character.rotation.set( data.data.rx, data.data.ry, data.data.rz )
							}
						})
						
						update_position_interval = setInterval( event =>{
						
							const kam = in_vr ? viewer.cameraRig : viewer.activeCamera
							
							multi.networksync.updateMyPosition({
								session_id, 
								px         : kam.position.x, 
								py         : kam.position.y, 
								pz         : kam.position.z,
								rx         : kam.rotation.x, 
								ry         : kam.rotation.y, 
								rz         : kam.rotation.z 
							})	
						}, update_position_time )
					})
				})
			}
			authorize()
        </script>
    </body>
</html>
";
        }
    }
